import { Key, useState } from 'react';
import { customAlphabet } from 'nanoid';
import s from './ItemList.module.css';
import useLocalState from '../../hooks';
import Item from '../Item/Item';

export default function ItemList() {
  const [items, setItems] = useLocalState('items', []);
  const [activeItem, setActiveItem] = useLocalState('activeItem', {
    length: 0,
    pop: function (): undefined {
      throw new Error('Function not implemented.');
    },
    push: function (...items: never[]): number {
      throw new Error('Function not implemented.');
    },
    concat: function (...items: ConcatArray<never>[]): never[] {
      throw new Error('Function not implemented.');
    },
    join: function (separator?: string | undefined): string {
      throw new Error('Function not implemented.');
    },
    reverse: function (): never[] {
      throw new Error('Function not implemented.');
    },
    shift: function (): undefined {
      throw new Error('Function not implemented.');
    },
    slice: function (
      start?: number | undefined,
      end?: number | undefined
    ): never[] {
      throw new Error('Function not implemented.');
    },
    sort: function (
      compareFn?: ((a: never, b: never) => number) | undefined
    ): [] {
      throw new Error('Function not implemented.');
    },
    splice: function (
      start: number,
      deleteCount?: number | undefined
    ): never[] {
      throw new Error('Function not implemented.');
    },
    unshift: function (...items: never[]): number {
      throw new Error('Function not implemented.');
    },
    indexOf: function (
      searchElement: never,
      fromIndex?: number | undefined
    ): number {
      throw new Error('Function not implemented.');
    },
    lastIndexOf: function (
      searchElement: never,
      fromIndex?: number | undefined
    ): number {
      throw new Error('Function not implemented.');
    },
    every: function <S extends never>(
      predicate: (value: never, index: number, array: never[]) => value is S,
      thisArg?: any
    ): this is S[] {
      throw new Error('Function not implemented.');
    },
    some: function (
      predicate: (value: never, index: number, array: never[]) => unknown,
      thisArg?: any
    ): boolean {
      throw new Error('Function not implemented.');
    },
    forEach: function (
      callbackfn: (value: never, index: number, array: never[]) => void,
      thisArg?: any
    ): void {
      throw new Error('Function not implemented.');
    },
    map: function <U>(
      callbackfn: (value: never, index: number, array: never[]) => U,
      thisArg?: any
    ): U[] {
      throw new Error('Function not implemented.');
    },
    filter: function <S extends never>(
      predicate: (value: never, index: number, array: never[]) => value is S,
      thisArg?: any
    ): S[] {
      throw new Error('Function not implemented.');
    },
    reduce: function (
      callbackfn: (
        previousValue: never,
        currentValue: never,
        currentIndex: number,
        array: never[]
      ) => never
    ): never {
      throw new Error('Function not implemented.');
    },
    reduceRight: function (
      callbackfn: (
        previousValue: never,
        currentValue: never,
        currentIndex: number,
        array: never[]
      ) => never
    ): never {
      throw new Error('Function not implemented.');
    },
    find: function <S extends never>(
      predicate: (value: never, index: number, obj: never[]) => value is S,
      thisArg?: any
    ): S | undefined {
      throw new Error('Function not implemented.');
    },
    findIndex: function (
      predicate: (value: never, index: number, obj: never[]) => unknown,
      thisArg?: any
    ): number {
      throw new Error('Function not implemented.');
    },
    fill: function (
      value: never,
      start?: number | undefined,
      end?: number | undefined
    ): [] {
      throw new Error('Function not implemented.');
    },
    copyWithin: function (
      target: number,
      start: number,
      end?: number | undefined
    ): [] {
      throw new Error('Function not implemented.');
    },
    entries: function (): IterableIterator<[number, never]> {
      throw new Error('Function not implemented.');
    },
    keys: function (): IterableIterator<number> {
      throw new Error('Function not implemented.');
    },
    values: function (): IterableIterator<never> {
      throw new Error('Function not implemented.');
    },
    includes: function (
      searchElement: never,
      fromIndex?: number | undefined
    ): boolean {
      throw new Error('Function not implemented.');
    },
    flatMap: function <U, This = undefined>(
      callback: (
        this: This,
        value: never,
        index: number,
        array: never[]
      ) => U | readonly U[],
      thisArg?: This | undefined
    ): U[] {
      throw new Error('Function not implemented.');
    },
    flat: function <A, D extends number = 1>(
      this: A,
      depth?: D | undefined
    ): FlatArray<A, D>[] {
      throw new Error('Function not implemented.');
    },
    at: function (index: number): undefined {
      throw new Error('Function not implemented.');
    },
    findLast: function <S extends never>(
      predicate: (value: never, index: number, array: never[]) => value is S,
      thisArg?: any
    ): S | undefined {
      throw new Error('Function not implemented.');
    },
    findLastIndex: function (
      predicate: (value: never, index: number, array: never[]) => unknown,
      thisArg?: any
    ): number {
      throw new Error('Function not implemented.');
    },
    toReversed: function (): never[] {
      throw new Error('Function not implemented.');
    },
    toSorted: function (
      compareFn?: ((a: never, b: never) => number) | undefined
    ): never[] {
      throw new Error('Function not implemented.');
    },
    toSpliced: function (
      start: number,
      deleteCount: number,
      ...items: never[]
    ): never[] {
      throw new Error('Function not implemented.');
    },
    with: function (index: number, value: never): never[] {
      throw new Error('Function not implemented.');
    },
    [Symbol.iterator]: function (): IterableIterator<never> {
      throw new Error('Function not implemented.');
    },
    [Symbol.unscopables]: undefined,
  });

  const [name, setName] = useState('');
  const nanoid = customAlphabet('1234567890', 8);
  const id = nanoid();

  const handleChange = (event: { target: any }) => {
    setName(event.target.value);
  };

  const handleSubmit = (event: { target: any; preventDefault: () => void }) => {
    event.preventDefault();

    setItems([...items, ...[{ id, name, comments: [] }]]);

    setName('');
  };

  const deleteEl = (elem: any) => {
    const deleted = items.filter((e: { id: any }) => e.id !== elem);
    setItems(deleted);
  };

  const activate = (elem: any) => {
    const active = items.filter((e: { id: any }) => e.id !== elem);
    setActiveItem(active);
  };
  console.log(activeItem);

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div className={s.searchForm}>
          <h2>Items</h2>
          <input
            placeholder="Type name here..."
            className={s.name}
            type="text"
            name="name"
            title="Place for adding items"
            required
            value={name}
            onChange={handleChange}
          />

          <button type="submit" className={s.ripple}>
            Add Item
          </button>
        </div>
      </form>
      <ul>
        {items.map(
          (e: {
            comments: any;
            d: Key | null | undefined;
            id: string;
            name: string;
          }) => {
            return (
              <Item
                key={e.id}
                id={e.id}
                itemName={e.name}
                deleteEl={deleteEl}
                comentsCalc={e.comments.length}
                active={activate}
              />
            );
          }
        )}
      </ul>
    </div>
  );
}
